        return (
            <div className='fixed-top'>
                <header>
                    <nav className="navbar navbar-expand-md bg-black">
                        <a href='/employees' className={Styles.logoImage}><img src={logo} alt="logo" /></a>
                    </nav>
                    <h5 className='text-end'>Employee Management App	<a class={Styles.b} href="">
                        <img src="https://pbs.twimg.com/profile_images/378800000639740507/fc0aaad744734cd1dbc8aeb3d51f8729_400x400.jpeg" />
                        <div class="logout">LOGOUT</div>
                    </a></h5>
                </header>
            </div>

        )
    }
}

export default HeaderComponent
